import { loadQuestion,loadQuestions } from '../../../model/actions';
import React, {useEffect,useState} from 'react'
import { useDispatch, useSelector } from 'react-redux'
import "./Other.css"
/*React UI component version (js and html) of the Other Q and A popup which appears when a 
user asks a question independent of docs*/
const Other = (params,emptyobject) => {
    //we call axios dispatch here
    const dispatch = useDispatch();
    var OtherQuestion = params['OtherQuestion']
    var howMany = params['howMany']
    console.log("oOther | hm",OtherQuestion, howMany)
    if (OtherQuestion == undefined) {
        OtherQuestion = ""
        howMany = 1
    }

    const {obj} = useSelector(state => state.data)
    useEffect(() => {
        dispatch(loadQuestion(OtherQuestion,howMany));
    }, [])

    return (<div>
            {obj && obj.map((item) => (
                <tbody>
                    <tr>
                        <td><b>{item.question}</b></td>
                        <td>{item.link}</td>
                    </tr>
                </tbody>
        ))}


    </div>)

}

export default Other;
